class Solution {
    func minimumCost(_ source: String, _ target: String, _ original: [Character], _ changed: [Character], _ cost: [Int]) -> Int {
        let n = source.count
        var dp = Array(repeating: Array(repeating: Int.max / 2, count: n + 1), count: n + 1)
        let s = Array(source), t = Array(target)
        dp[0][0] = 0

        for i in 0...n {
            for j in 0...n {
                if i < n { dp[i + 1][j] = min(dp[i + 1][j], dp[i][j]) } // skip source[i]
                if j < n { dp[i][j + 1] = min(dp[i][j + 1], dp[i][j]) } // skip target[j]
                if i < n && j < n {
                    let costIndex = original.firstIndex(of: s[i])
                    if s[i] == t[j] || (costIndex != nil && changed[costIndex!] == t[j]) {
                        let changeCost = (s[i] == t[j]) ? 0 : cost[costIndex!]
                        dp[i + 1][j + 1] = min(dp[i + 1][j + 1], dp[i][j] + changeCost)
                    }
                }
            }
        }

        return dp[n][n] < Int.max / 2 ? dp[n][n] : -1
    }
}
